import React from "react";
import "./App.css";
import Navbar from '../src/Navbar/Nav_Top';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Nav_Top from "./Navbar/Nav_Top";
import Main from './Main_info/Main';
import Header from "./Header/Header";
import AboutUS from './aboutus/AboutUS'

const App = () => (
    <Router>
        <div className="App">
            <Route exact path='/' componunt={Nav_Top}/>
            <Route path ='./Main_info/Main' compomunt={Main}/>
            <Route path ="./Header/Header" compomunt={Header}/>
            <Route path ='./aboutus/AboutUS' compomunt={AboutUS}/>
        </div>
    </Router>
);




export default App;
